import React from 'react';
import axios from 'axios';

function httpcall(){
  axios.get("http://localhost:8080/todo").then(function(res){
    console.log(res.data.errors);
    return res.data.data;
  });
}

function Data({title}){
return <h1>title : {title}</h1>
}

function App() {
  var data = [];
  data = httpcall();
  return (
    <div className="App">
      <h1>{data.map(hmm => <Data title={hmm.title}/> )}</h1>
    </div>
  );
}

export default App;
